import React from 'react';

import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';

/* export default function test({ countries, handleOnChange, value }) {

    return (
        <div className='item'>
            <select className='item_list'>
                {countries.map(({ Country, ISO2 }) => (
                    <option key={ISO2} value={ISO2.toLowerCase()}>
                        {Country}
                    </option>
                ))}
            </select>
        </div>
    );
} */

export default function /* ComboBox */ test() {
    return (
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={countries.map(({ Country, ISO2 }) => (
            <option key={ISO2} value={ISO2.toLowerCase()}>
                {Country}
            </option>
        ))}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="Movie" />}
        
      />
      
    );
  }
